var title_f31_48_32513="Overhead arm raise exercise";
var content_f31_48_32513=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F74052&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F74052&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Strength exercise: Overhead arm raise",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 374px; height: 306px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This exercise will strengthen your shoulders and arms. It should make swimming and other activities such as lifting and carrying grandchildren easier.",
"    <ol>",
"     <li>",
"      You can do this exercise while standing or sitting in a sturdy, armless chair.",
"     </li>",
"     <li>",
"      Keep your feet flat on the floor, shoulder-width apart.",
"     </li>",
"     <li>",
"      Hold weights* at your sides at shoulder height with palms facing forward. Breathe in slowly.",
"     </li>",
"     <li>",
"      Slowly breathe out as you raise both arms up over your head keeping your elbows slightly bent.",
"     </li>",
"     <li>",
"      Hold the position for one second.",
"     </li>",
"     <li>",
"      Breathe in as you slowly lower your arms.",
"     </li>",
"     <li>",
"      Repeat 10 to 15 times.",
"     </li>",
"     <li>",
"      Rest; then repeat 10 to 15 more times.",
"     </li>",
"    </ol>",
"    As you progress, use a heavier weight and alternate arms until you can lift the weight comfortably with both arms.",
"    <div class=\"footnotes\">",
"     * Hand-held weights or household items (soup cans, bottles of water).",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Go4Life. National Institute on Aging at the National Institutes of Health. Available at: file://go4life.niapublications.org (Accessed December 2, 2011).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
