"   </div>",
"   <div class=\"lgnd\">",
"    A. A small number of lymphocytes adhering to the epidermis seen in the resting lesional skin (H &amp; E stain; &times;66). B. Absence of lymphocytes in the epidermis of the adjacent uninvolved perilesional skin (H &amp; E stain; x66).",
