"       </td>",
"       <td rowspan=\"3\">",
"        <strong>",
"         70",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Dystrophic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Small thin nail plates with ridges",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\">",
"        <strong>",
"         Skin*",
