"       <td rowspan=\"2\">",
"        <strong>",
"         67",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Reticular pigmentation",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
