"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Strabismus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Cataracts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Absent eyelashes",
