"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Corneal ulcers",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\">",
"        <strong>",
"         Hair",
"        </strong>",
"       </td>",
"       <td rowspan=\"3\">",
"        <strong>",
"         19",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
