"       </td>",
"       <td rowspan=\"4\">",
"        <strong>",
"         13",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Abnormally shaped or missing teeth",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Periodontitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Prone to caries",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
