"       <td rowspan=\"3\">",
"        <strong>",
"         12",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Esophageal stenosis (8 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hepatic fibrosis",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\">",
"        <strong>",
"         Skeletal",
"        </strong>",
"       </td>",
"       <td rowspan=\"4\">",
"        <strong>",
"         12",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Short stature",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Osteopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Avascular necrosis of the hip",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\">",
"        <strong>",
"         Head",
