"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Microcephaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Cerebellar hypoplasia (Hoyeraal-Hreidarsson syndrome)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Dandy-Walker malformation",
