"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Pulmonary fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Atrial or ventricular septal defect",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\">",
"        <strong>",
"         Genitourinary",
"        </strong>",
"       </td>",
"       <td rowspan=\"5\">",
"        <strong>",
"         7",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Phimosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Meatal stenosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hypospadias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Penile leukoplakia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
